import React from "react";

import {
  Address,
  AddressRow,
  Container,
  LocationIconContainer,
  SelectedAddressContainer,
  SubTitle,
  Title,
} from "./styles";

const Endereco: React.FC = () => {
  return (
    <Container>
      <Title>Como você quer receber ou retirar sua compra?</Title>
      <SelectedAddressContainer>
        <SubTitle>Endereço de entrega</SubTitle>
        <AddressRow>
          <LocationIconContainer></LocationIconContainer>
          <Address>
            Avendida 26 de outubro, número 4000.
            <br />
            Bairro Bela Vista, Ipatinga - MG.
            <br />
            CEP: 35.160-208.
          </Address>
        </AddressRow>
      </SelectedAddressContainer>
    </Container>
  );
};

export default Endereco;
